import React from 'react';

const Hello = (props) => {
	return (
		<div>
			<p>Hello {props.name}</p>
		</div>
	);
};

const App = () => {
	return (
		<div>
			<h1>Greeting</h1>
			<Hello />
			<Hello />
			<Hello />
		</div>
	);
};

export default App;
